import React, { useEffect, useState } from "react";
import axios from "axios";
import { getAccessToken } from "../utils/authUtils";
import { getStompClient } from "../api/websocket"; // ‚úÖ WebSocket ÌÅ¥ÎùºÏù¥Ïñ∏Ìä∏ Í∞ÄÏ†∏Ïò§Í∏∞
import "../styles/InviteList.css"; 

const InviteList = ({ refreshProjects }) => {
  const [invites, setInvites] = useState([]);
  const [notifications, setNotifications] = useState([]);

  // ‚úÖ Ï¥àÎåÄ Î™©Î°ù Í∞ÄÏ†∏Ïò§Í∏∞
  const fetchInvites = async () => {
    const token = getAccessToken();
    try {
      const response = await axios.get("http://localhost:8082/api/team/invites", {
        headers: { Authorization: `Bearer ${token}` },
      });
      console.log("üìå Î∞õÏùÄ Ï¥àÎåÄ Î™©Î°ù:", response.data);
      setInvites(response.data);
    } catch (error) {
      console.error("‚ùå Ï¥àÎåÄ Î™©Î°ù Î∂àÎü¨Ïò§Í∏∞ Ïã§Ìå®:", error);
    }
  };

  useEffect(() => {
    fetchInvites();

    const stompClient = getStompClient();
    if (!stompClient.connected) {
      stompClient.onConnect = () => {
        console.log("‚úÖ WebSocket Ïó∞Í≤∞ ÏÑ±Í≥µ & Ï¥àÎåÄ ÏïåÎ¶º Íµ¨ÎèÖ ÏãúÏûë");
        stompClient.subscribe("/topic/invites", (message) => {
          const newInvite = JSON.parse(message.body);
          console.log("üì© ÏÉà Ï¥àÎåÄ ÏïåÎ¶º ÏàòÏã†:", newInvite);
          setNotifications((prev) => [...prev, newInvite]);
        });
      };
      stompClient.activate();
    }

    return () => {
      console.log("üõë WebSocket Ìï¥Ï†ú");
      if (stompClient && stompClient.connected) {
        stompClient.deactivate();
      }
    };
  }, []);

  // ‚úÖ Ï¥àÎåÄ ÏàòÎùΩ Ï≤òÎ¶¨
  const handleAcceptInvite = async (inviteId) => {
    const token = getAccessToken();
    try {
      await axios.post(`http://localhost:8082/api/team/invites/${inviteId}/accept`, {}, {
        headers: { Authorization: `Bearer ${token}` },
      });
      console.log(`‚úÖ Ï¥àÎåÄ(${inviteId}) ÏàòÎùΩ`);
      fetchInvites(); // Î¶¨Ïä§Ìä∏ Í∞±Ïã†
      refreshProjects(); // ÌîÑÎ°úÏ†ùÌä∏ Î™©Î°ù Í∞±Ïã†
    } catch (error) {
      console.error("‚ùå Ï¥àÎåÄ ÏàòÎùΩ Ïã§Ìå®:", error);
    }
  };

  // ‚úÖ Ï¥àÎåÄ Í±∞Ï†à Ï≤òÎ¶¨
  const handleRejectInvite = async (inviteId) => {
    const token = getAccessToken();
    try {
      await axios.post(`http://localhost:8082/api/team/invites/${inviteId}/reject`, {}, {
        headers: { Authorization: `Bearer ${token}` },
      });
      console.log(`‚ùå Ï¥àÎåÄ(${inviteId}) Í±∞Ï†à`);
      fetchInvites();
    } catch (error) {
      console.error("‚ùå Ï¥àÎåÄ Í±∞Ï†à Ïã§Ìå®:", error);
    }
  };

  return (
    <div className="invite-list-container">
      <h3>üì© Ï¥àÎåÄ Î∞õÏùÄ Î™©Î°ù</h3>

      {/* ‚úÖ Ï¥àÎåÄ Î™©Î°ù ÌëúÏãú (PENDING ÏÉÅÌÉúÎßå) */}
      {invites.filter(invite => invite.status === "PENDING").length === 0 ? (
        <p>üì≠ ÎåÄÍ∏∞ Ï§ëÏù∏ Ï¥àÎåÄÍ∞Ä ÏóÜÏäµÎãàÎã§.</p>
      ) : (
        invites
          .filter(invite => invite.status === "PENDING")
          .map((invite) => (
            <div key={invite.id} className="invite-card">
              <p>
                <strong>{invite.sender.username}</strong> ÎãòÏù¥ <strong>{invite.project.name}</strong> ÌîÑÎ°úÏ†ùÌä∏Ïóê Ï¥àÎåÄÌñàÏäµÎãàÎã§.
              </p>
              <div className="invite-buttons">
                <button className="accept-btn" onClick={() => handleAcceptInvite(invite.id)}>‚úÖ ÏàòÎùΩ</button>
                <button className="reject-btn" onClick={() => handleRejectInvite(invite.id)}>‚ùå Í±∞Ï†à</button>
              </div>
            </div>
          ))
      )}

      {/* ‚úÖ WebSocketÏùÑ ÌÜµÌï¥ Î∞õÏùÄ Ï¥àÎåÄ ÏïåÎ¶º */}
      {notifications.length > 0 && (
        <div className="invite-popup-container">
          {notifications.map((invite) => (
            <div key={invite.id} className="invite-popup">
              <p>
                <strong>{invite.sender.username}</strong> ÎãòÏù¥ <strong>{invite.project.name}</strong> ÌîÑÎ°úÏ†ùÌä∏Ïóê Ï¥àÎåÄÌñàÏäµÎãàÎã§.
              </p>
              <button onClick={fetchInvites}>‚úÖ ÌôïÏù∏</button>
            </div>
          ))}
        </div>
      )}
    </div>
  );
};

export default InviteList;
